-- ----------------------------
-- Triggers structure for table barang_rusak
-- ----------------------------
DROP TRIGGER IF EXISTS `cut_stock_barang_rusak`;
delimiter ;;
CREATE TRIGGER `cut_stock_barang_rusak` AFTER INSERT ON `barang_rusak` FOR EACH ROW BEGIN 
		UPDATE barang SET stok = stok-NEW.qty
    WHERE kode_barang=NEW.kode_barang;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table barang_rusak
-- ----------------------------
DROP TRIGGER IF EXISTS `rollback_stock_barang_rusak`;
delimiter ;;
CREATE TRIGGER `rollback_stock_barang_rusak` BEFORE DELETE ON `barang_rusak` FOR EACH ROW BEGIN 
	DECLARE beforeQty integer;

	SET @beforeQty := (SELECT qty FROM barang_rusak WHERE no_barang_rusak = OLD.no_barang_rusak);
		UPDATE barang SET stok = stok+@beforeQty
    WHERE kode_barang=OLD.kode_barang;
END
;;
delimiter ;

-- ----------------------------
-- Triggers structure for table barang_rusak
-- ----------------------------
DROP TRIGGER IF EXISTS `repair_stock_barang_rusak`;
delimiter ;;
CREATE TRIGGER `repair_stock_barang_rusak` AFTER UPDATE ON `barang_rusak` FOR EACH ROW BEGIN 
		UPDATE barang SET stok = stok+OLD.qty-NEW.qty
    WHERE kode_barang=NEW.kode_barang;
END
;;
delimiter ;

